CREATE TABLE `dpo_activity` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Id',
  `name` varchar(255) DEFAULT NULL COMMENT '活动名称',
  `sign_begin` datetime DEFAULT NULL COMMENT '报名开始时间',
  `sign_end` datetime DEFAULT NULL COMMENT '报名结止时间',
  `act_begin` datetime DEFAULT NULL COMMENT '活动开始时间',
  `act_end` datetime DEFAULT NULL COMMENT '活动结止时间',
  `location` varchar(255) DEFAULT NULL COMMENT '活动地点',
  `head_img` varchar(255) DEFAULT NULL COMMENT '上传活动头图',
  `small_img` varchar(255) DEFAULT NULL COMMENT '上传活动小图',
  `content` text COMMENT '上传详情',
  `contract` varchar(32) DEFAULT NULL COMMENT '联系电话',
  `price` decimal(10,0) DEFAULT NULL COMMENT '活动金额',
  `full_num` int DEFAULT NULL COMMENT '限制人数',
  `status` int DEFAULT NULL COMMENT '状态',
  `is_marketable` bit(1) DEFAULT NULL COMMENT '是否上架',
  `marketable_time` datetime DEFAULT NULL COMMENT '上架时间',
  `version` int DEFAULT NULL COMMENT '版本',
  `delete_flag` bit(1) DEFAULT NULL COMMENT '删除标记',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `tenant_id` int DEFAULT NULL COMMENT '租户ID',
  `park_id` int DEFAULT NULL COMMENT '园区id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb3 COMMENT='活动管理';
