INSERT INTO `dpo_dj` VALUES (1,'关于组织开展孵化器企业年度评审的公告','<p>1、2019年度省级科技企业孵化器的评审工作按《通知》要求由扬州市科技局组织开展，经专家评审和实地核查，对公示无异议符合条件的科技企业孵化器报省科技厅审核。各县（市、区）、功能区科技部门负责辖区内省级科技企业孵化器的申报推荐工作。<br><br>2、地方推荐上报的科技企业孵化器须符合《江苏省科技企业孵化器管理办法》（苏科技规〔2019〕206号）和《通知》规定的条件，并按照《通知》和本通知要求准备申报材料。<br><br>3、申报省级科技企业孵化器的单位，向所在地科技部门提出申请，并承担申报主体责任，确保申报材料的真实性、有效性和完整性，提交申报单位信用承诺书（见附件2）。<br><br>4、各县（市、区）、功能区科技部门组织对辖区内省级科技企业孵化器申报单位提交的申报材料进行审核，并进行实地核查，确保上报数据和材料的真实、准确、完整，严禁审核走过场、流于形式。在审核无误的基础上，出具主管部门信用承诺书（见附件3）。<br><br>5、各县（市、区）、功能区科技部门对辖区内省级科技企业孵化器申报材料审核时，要认真落实中央八项规定精神，严格执行科技管理系统“六项承诺”和“八个严禁”规定，把党风廉政建设和省级科技企业孵化器申报工作同部署、同落实、同考核，切实加强关键环节和重点岗位的廉政风险防控，积极主动做好省级科技企业孵化器申报的各项服务工作，进一步提高服务质量和办事效率。</p>',_binary '','2023-04-30 00:43:25',NULL,_binary '\0','liqingsong','2023-04-30 00:43:22','liqingsong','2023-04-30 00:43:25',1,1);
/*!40000 ALTER TABLE `dpo_dj` ENABLE KEYS */;
UNLOCK TABLES;

