INSERT INTO `dpo_policy` VALUES (9,'招商引资政策','<p>一、财税金融政策<br><br>1.对年度入库地方税收形成的可用财力首次突破200万元的，奖励20万元；首次突破500万元的，奖励50万元；首次突破1000万元的，奖励100万元。对当年实现地方税收形成的可用财力达到1000万元的企业，另外按照其实现地方税收形成的可用财力的1%奖励，最高不超过100万元。（丰政发〔2017〕4号）<br><br>2.对在沪深股市及海外上市的企业（指上市主体在我县的企业），成功上市后一次性奖励300万元；在“新三板”挂牌成功的，一次性奖励30万元。（丰政发〔2017〕4号）</p>',_binary '','2023-04-30 00:32:31',NULL,_binary '\0','liqingsong','2023-04-30 00:32:28','manager','2024-10-24 19:34:30',1,1),(10,'育强政策','<p>1.对企业应税销售收入5000万元以上（含5000万元，但不包括关联交易金额）且增幅达到15%以上（含），在上一年度基础上，每新增1000万元奖励5万元，最高不超过20万元。对首次达到10亿元、20亿元、50亿元、100亿元的，分别奖励10万元、20万元、50万元、100万元。每新增1家列统工业企业，一次性奖励企业1万元。（丰政发〔2017〕4号）<br><br></p><p>2.企业首次进入全国制造业500强，奖励50万元，同时以企业首次进入全国制造业500强排名为基点，每前进5位，再奖励20万元；企业首次进入国内同行业50强，奖励20万元，同时以企业已进入国内同行业50强排名为基点，每前进10位，再奖励5万元。对首次进入国内同行业第一的企业，奖励50万元，资金与首次进入国内同行业50强奖励不重复计算。对企业既首次进入全国制造业500强，又进入国内同行业50强的，按照前者奖励标准执行，不再重复奖励。（丰政发〔2017〕4号）<br><br></p><p>3.企业参加境内各类省级以上专业展销会、订货会、博览会等，且参会前在县发改委、商务局报备，会后提供合同、发票及参展相关资料证明，按照参展展位费超出10万元的部分给予50%补助，补助金额最高10万元。（丰政发〔2017〕4号）<br><br></p><p>4.对经过县项目会审委员会会审的产业项目，根据当年实际完成投资额予以分档补助。其中：总投资在10亿元以上（含10亿元）的项目，给予100万元的补助；总投资在5-10亿元（含5亿元）的项目，给予50万元的补助；总投资在1-5亿元（含1亿元）的项目，给予10万元的补助；总投资在0.5亿元-1亿元（含0.5亿元）的项目，给予5万元的补助。（丰政发〔2017〕4号）<br><br></p><p>5.对新列入国家级、省级首台（套）重大装备及关键部件认定范围的企业，分别奖励30万元、10万元；对新列入省重点推广应用的新技术新产品目录的企业，奖励10万元；对新通过国家级、省级鉴定的新产品新技术，分别奖励10万元、5万元。（丰政发〔2017〕4号）<br><br></p><p>6.对新获中国驰名商标、中国名牌产品的生产型企业，奖励30万元；对获批地理标志产品的企业，奖励10万元；对新获国家免检产品、江苏名牌产品或江苏著名商标企业，奖励10万；对新获境外商标的企业，奖励5万元。（丰政发〔2017〕4号）<br><br></p><p>7.对列入全国标准化技术专业委员会以及分技术委员会的单位，分别奖励30万元、10万元；对提出国际标准组织标准研制项目、国家标准研制项目并作为标准主要起草成员的单位，分别奖励30万元、10万元；对提出行业标准研制项目、省级地方标准或技术规范研制项目并作为标准主要起草成员的单位，分别奖励10万元、5万元；对创建标准化达到国家4A级、国家3A级、省4A级的企业，分别奖励30万元、10万元、5万元。（丰政发〔2017〕4号）<br><br></p><p>8.对新获全国质量奖、江苏省质量奖的企业，分别奖励30万元、10万元。（丰政发〔2017〕4号）<br><br></p><p>9.对与省级以上研发力量较强、拥有专利技术的科研院所重组合作，或对与拥有自主核心技术、专利产品的高层次人才及团队联合、参股、管理企业，双方确定占股比例、完成工商变更登记、实现新产品新技术（经省级以上部门认定）投产达效的，一次性奖励20万元。鼓励本土企业为提高综合竞争力组建企业集团，对经过注册的国家级、省级企业集团，分别一次性奖励30万元、10万元。（丰政发〔2017〕4号）</p>',_binary '','2023-04-30 00:36:35',NULL,_binary '\0','liqingsong','2023-04-30 00:36:31','manager','2024-10-24 19:34:34',1,1);
